import React from "react";
import one from "./one";
import two from "./two";

const merge = () => {
  return (
    <div className="flex flex-col">
      <div className="w-1/2 p-4">
        <one />
      </div>
      <div className="w-1/2 p-4">
        <two />
      </div>
    </div>
  );
};
export default merge;
